import React from 'react';

function Car(props) {
    return <p>Buy this {props.color} car now!</p>;
}

const header = (<div>
    <header style={{margin: 0}}>
        <table style={{textAlign: 'center', width: "100%", border: "3px thin black"}}>
            <th style={{height:'10em', paddingTop: '5em'}}>
    <h1 style={{}}>Fi$Pond</h1>
            </th>
            <tr>
        <p style={{color: "red"}}>Your Solution, our catalog</p>
        <br/>
            </tr>
            <tr>
        <span>
            <Car color = "blue"/>
        </span>
            </tr>
        </table>
    </header>
    </div>);

let usere = header;

function Headr()   {
    return usere;
}

export default Headr;
